package practice.Switch;

public class SwitchMulticaseTen {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num =8;
		String numString = null;
		switch (num){
			case 10: numString = "10";
			System.out.println(numString);
	
			case 9: numString = "9";
			System.out.println(numString);
			
			case 8: numString = "8";
			System.out.println(numString);
			
			case 7: numString = "7";
			System.out.println(numString);
			
			case 6: numString = "6";
			System.out.println(numString);

			case 5: numString = "5";
			System.out.println(numString);

			case 4: numString = "4";
			System.out.println(numString);

			case 3: numString = "3";
			System.out.println(numString);

			case 2: numString = "2";
			System.out.println(numString);

			case 1: numString = "1";
			System.out.println(numString);

		}
		
	}
	
}
